import './Dropdown.css'

const Dropdown = (props) => {
    return(
        <div className="dropdown">
            <button><a href="#">{props.value}</a></button>
            <div className="dropdown-menu">
                {props.component}
            </div>
        </div>
    );
}

export default Dropdown;
